import React from 'react'


export default class AddressComponent extends React.Component{
    render(){
        return(
            <Grid container justify="center" direction="column" alignItems="center" spacing={5}>
                <Grid item xs={12}>
                    <h1 style={{color: '#084177'}}>Address Information</h1>
                </Grid>
            </Grid>
        )
    }
}
